import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Navbar.css"
import logo from "../assets/toyota_logo.png"; // Adjust this path

const Navbar = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  return (
    <nav className="bg-white shadow-md">
      <div className="container mx-auto px-4 py-2 flex items-center justify-between">
        {/* Toyota Logo */}
        <img src={logo} alt="Toyota Logo" className="h-12" />

        {/* Navigation Links */}
        <ul className="flex space-x-6 text-gray-700 font-semibold">
          <li>
            <Link to="/" className="hover:text-red-600">Home</Link>
          </li>
          <li>
            <Link to="/about" className="hover:text-red-600">About</Link>
          </li>

          {/* Dropdown Menu for Products */}
          <li className="relative">
            <button
              onMouseEnter={() => setDropdownOpen(true)}
              onMouseLeave={() => setDropdownOpen(false)}
              className="hover:text-red-600"
            >
              Products
            </button>

            {/* Dropdown Content */}
            {dropdownOpen && (
              <div 
                className="absolute left-0 top-10 bg-white shadow-lg p-4 grid grid-cols-2 gap-4 w-72"
                onMouseEnter={() => setDropdownOpen(true)}
                onMouseLeave={() => setDropdownOpen(false)}
              >
                {/* Car Images */}
                <div>
                  <img src="https://source.unsplash.com/100x50/?car" alt="Car 1" className="mb-2" />
                  <img src="https://source.unsplash.com/100x50/?suv" alt="Car 2" />
                </div>

                {/* Car Model Links */}
                <div>
                  <Link to="/models/suvs" className="block hover:text-red-600">SUVs</Link>
                  <Link to="/models/sedans" className="block hover:text-red-600">Sedans</Link>
                  <Link to="/models/mpvs" className="block hover:text-red-600">MPVs</Link>
                </div>
              </div>
            )}
          </li>

          <li>
            <Link to="/contact" className="hover:text-red-600">Contact</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
